    Jones    C/o Federal Elections Commission    Washington, DC 20463     RE: RQ-2
    October Quarterly Report (7/1/2008-9/30/2008) Clarification of Purposes.     Dear
    Mr. Jones,     This is in response to your letter dated November 4th, 2008. In
    an effort to comply with full disclosure the campaign reviewed all descriptions
    of disbursements as initially reported. Descriptions not falling within the parameters
    set by commission regulations and those found on the inadequate purpose list were
    changed and an amended report has been filed. Specifically the descriptions initially
    describe as production were amended to say media production. A description initially
    listed as retainer was amended to read research.     Please feel free to contact
    us with additional concerns or questions and we appreciate you bringing this to
    our attention and we will make adjustments to our internal procedures to avoid
    this problem in the future.     Sincerely,     Steve Okey  Treasurer"
